import React from "react";
import {
    StyleSheet,
    Text,
    View,
    Image,
    TextInput,
    Button,
    Alert,
    Switch,
    Linking,
  } from "react-native";

function MainTitle( { title }) {
  return (
    <Text className="text-5xl text-teal-100 my-6">
    {title}
    </Text>
  );
}

export default MainTitle;
